import React, { useState, useEffect } from 'react';

export default function Start() {
    const [text, setText] = useState('');
    const adjectives = ["awesome", "fun", "interactive", "user-friendly", "intuitive"];

    useEffect(() => {
        const intervalId = setInterval(() => {
            // Update the text content every second
            setText(adjectives[Math.floor(Math.random() * length(adjectives))]);
        }, 1000);

        // Cleanup function to clear the interval when the component unmounts
        return () => clearInterval(intervalId);
    }, []); // Empty dependency array to run the effect only once on mount

    const generateNewText = () => {
        // Generate new text content here
        return 'new text';
    };

    return (
        <div id='titleScreen'>
            <p>Hello, I am</p>
            <h1 className='BLACKOUT'>tyra woden</h1>
            <p>I have a passion for creating <span className='blue'>{text}</span> digital experiences.</p>
        </div>
    );
}
